async function roleSeed() {
  for (const role of dataRole) {
    const existing = await db
      .select()
      .from(Role)
      .where(eq(Role.NamaRole, role.namaRole));

    if (existing.length === 0) {
      await db.insert(Role).values({
        NamaRole: role.namaRole,
        Aktif: role.aktif,
        StatusRole: role.statusRole as "PUBLIC" | "PRIVATE",
        Keterangan: role.keterangan
      });
    }
  }
}

async function layananSeed() {
  for (const layanan of dataLayanan) {
    const existing = await db
      .select()
      .from(Layanan)
      .where(eq(Layanan.NamaLayanan, layanan.namaLayanan));

    if (existing.length === 0) {
      await db.insert(Layanan).values({
        NamaLayanan: layanan.namaLayanan,
        Keterangan: layanan.keterangan,
        Icon: layanan.icon,
        Url: layanan.url
      });
    }
  }
}

async function sektorSeed() {
  for (const sektor of dataSektor) {
    const existing = await db
      .select()
      .from(Sektor)
      .where(eq(Sektor.NamaSektor, sektor.namaSektor));

    if (existing.length === 0) {
      await db.insert(Sektor).values({
        NamaSektor: sektor.namaSektor,
        Status: sektor.status,
        Deskripsi: sektor.deskripsi
      });
      console.log(`Inserted: ${sektor.namaSektor}`);
    } 
  }
}

async function seed() {
  console.log("Seeding database...");
  await roleSeed();
  await sektorSeed();
  await layananSeed();
  console.log("Seeding completed!");
}

seed();